-- 4. tChannelPartnerIDTypeMapping table

IF NOT EXISTS(SELECT 1 FROM tChannelPartnerIDTypeMapping WHERE ChannelPartnerId = 'F8365E3B-FDD5-439A-BE9E-9B4444E17ED6')
BEGIN
	SELECT 'F8365E3B-FDD5-439A-BE9E-9B4444E17ED6', IT.NexxoIdTypePK, 1
	FROM tNexxoIdTypes IT
	WHERE (IT.Name IN ('DRIVER''S LICENSE', 'Military ID', 'U.S. STATE IDENTITY CARD', 'GREEN CARD / PERMANENT RESIDENT CARD', 'EMPLOYMENT AUTHORIZATION CARD (EAD0') AND IT.Country = 'UNITED STATES')
		OR (IT.Name = 'MATRICULA CONSULAR' AND IT.Country = 'MEXICO')
		OR (IT.Name IN ('PASAPORTE', 'PASSPORT'))
END	


